  \"access_constraints\",\n\t\t\"value\": \"[\"Use Constraints: This data set was
  digitized from a map published at a scale of 1:250,000. The map represents the elevations
  of the water levels in the alluvial and terrace deposits along the North Canadian
  River from Canton Lake to Lake Overholser in central Oklahoma, during 1980 (Christenson,
  1983). Water-level elevation contours represented at this scale are indicative of
  broad, regional trends and should not be interpreted as site specific. The water-level
  elevation contours were digitized from a folded paper map (19 inches by 17 inches)
  with a root-mean-squared-error (RMSE) of 0.008 map inches (0.020 map centimeters)
  or 175.32 feet (53.44 meters) ground distance.\", \"Access Constraints: None.\"]\"\n\t},\n\t{\n\t\t\"key\":
